Wanneer twee vrienden en tevens collega's het helemaal lijken te hebben gemaakt worden plots hun plannen gedwarsboomd. Zij moeten 
twee weken op een zesjarige tweeling passen. Maar wat moeten de twee mannen ermee? Ze nemen de kinderen mee naar een zomerkamp 
waar zij door de kampleider worden aangezien als homo-koppel. Voor de zekerheid houdt hij een oogje in het zeil.
